```json
{
  "application": "obs_interp",
  "software": [
    "mvapich2/1.2.0-intel",
    "netcdf",
    "intel.compiler",
    "cray-parallel-netcdf/1.8.1.3"
  ],
  "resource_requirements": {
    "walltime": "00:03:00",
    "nodes": "1",
    "ppn": "1",
    "queue": "mpp2testq",
    "account": "hbk00064"
  },
  "environment_variables": {
    "F_UFMTENDIAN": "big"
  }
}
```

This script runs the **obs_interp** application. It uses a number of software modules including mvapich2, netcdf, intel compiler, and cray-parallel-netcdf. It also requests specific resources from the PBS system including a walltime of 3 minutes, one node, one processor per node, and uses the mpp2testq queue with the hbk00064 account. Finally, it sets the environment variable F_UFMTENDIAN to 'big'.
